const database =[
    'Service 1',
    'Service 2',
    'Service 3',
    'Service 4'

]

// style={{background: `url(${Image})`}}
function App() {

  return (
    <div className="App">
        <NavMenu />
        <div className="serviceContainer" >
            {database.map((cardElement) => {
                return (<ServiceCard title={cardElement}/>)
            })}
        </div>
    </div>
  );
}

export default App;
